You can use the following code in GDscript to create a before step controller script and use it on a KinematicBody node in Godot Engine 3.x:
```gd
// Create the before step controller script.
var beforeStepControllerScript = script(function(script)
    script.on_step = function(self)
        print("Before step!")
    end
end)

// Assign the before step controller script to the kinematic body.
var body = find_node<KinematicBody>(get_node<Node>())
body.before_step_controller = beforeStepControllerScript
```
To make it work in Godot Engine 4.x, you will need to replace the last line of the code above with the following:
```gd
// Create the before step controller script.
var beforeStepControllerScript = script(function(script)
    script.on_step = function(self)
        print("Before step!")
    end
    function on_before_step(self, child):
        print("Before step for child", child)
    end
end)

// Assign the before step controller script to the kinematic body.
var body = find_node<KinematicBody>(get_node<Node>())
body.before_step_controller = beforeStepControllerScript
body.before_step_controller.on_before_step = on_before_step
```

