1. Create a C++ file named "main.cpp" and add the following code to it:

    ```cpp
    using namespace std;

    int main() {
        string inputFile = "filename.txt";

        ifstream is(inputFile.c_str());

        if (!is) {
            std::cerr << "Could not open input file: " << inputFile << std::endl;
            return EXIT_FAILURE;
        }

        int counter = 0;
        while (is) {
            string line;
            getline(is, line);
            counter++;
